create database if not exists `Twitter`;
use `Twitter`;

drop table if exists Users;
create table Users(
userName VARCHAR(32),
firstName VARCHAR(32),
lastName VARCHAR(32),
sex VARCHAR(8),
birthDay INT,
birthMonth INT,
birthYear INT,
userDescription VARCHAR(2048),
primary key (userName));

drop table if exists Topics;
create table Topics(
topic VARCHAR(64),
primary key (topic)
);

drop table if exists Tweets;
create table Tweets(
tweetID BIGINT,
airline_sentiment VARCHAR(8),
airline_sentiment_confidence FLOAT,
negativereason VARCHAR(32),
negativereason_confidence FLOAT,
topic VARCHAR(32),
airline_sentiment_gold VARCHAR(32),
userName VARCHAR(32),
negativereason_gold VARCHAR(64),
retweet_count INT,
likes INT,
post_day INT,
post_month INT,
post_year INT,
tweetText VARCHAR(2048),
primary key (tweetID),
foreign key (userName) references Users(userName),
foreign key (topic) references Topics(topic));

drop table if exists FollowPeople;
create table FollowPeople(
follower VARCHAR(32),
receiver VARCHAR(32),
primary key(follower, receiver),
foreign key(follower) references Users (userName),
foreign key(receiver) references Users (userName)
);

drop table if exists FollowTopic;
create table FollowTopic(
follower VARCHAR(32),
fTopic VARCHAR(32),
primary key(follower, fTopic),
foreign key(follower) references Users (userName),
foreign key(fTopic) references Topics (topic)
);

drop table if exists Responses;
create table Responses(
original BIGINT,
response BIGINT,
primary key(original, response),
foreign key(original) references Tweets (tweetID),
foreign key(response) references Tweets (tweetID)
);






